import React from 'react';

function TablesNavPage(props) {
  switch (props.inputType) {
    case('input') :
    inputElement=<input  {...props}/>
      
      break;
      case('textarea') :
    inputElement=<textarea {...props}/>
      
      break;
    default:
      inputElement=<input  {...props}/>
      break;
  }
  
  return (
    <div>
      <label>{props.label}</label>
      {inputElement}
    </div>
  );
}

export default TablesNavPage;
